import { useEffect, useState } from "react";
import { View, Text } from "react-native";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  PieChart,
  Pie,
  Cell,
  Legend,
} from "recharts";

import styles from "./styles";

export default function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:8000/sunshine")
      .then((res) => res.json())
      .then((json) => setData(json.sunshine))
      .catch((err) => console.log("Fetch error:", err));
  }, []);

  // ---- Insights ----
  const avg = data.length
    ? (data.reduce((a, b) => a + b.hours, 0) / data.length).toFixed(1)
    : 0;
  const max = data.length ? Math.max(...data.map((d) => d.hours)) : 0;
  const min = data.length ? Math.min(...data.map((d) => d.hours)) : 0;

  // ---- Historical trend (last week vs this week) ----
  let pieData = [];
  if (data.length >= 14) {
    const lastWeek = data.slice(0, 7);
    const thisWeek = data.slice(7, 14);

    const lastAvg = (
      lastWeek.reduce((a, b) => a + b.hours, 0) / lastWeek.length
    ).toFixed(1);
    const thisAvg = (
      thisWeek.reduce((a, b) => a + b.hours, 0) / thisWeek.length
    ).toFixed(1);

    pieData = [
      { name: `Last week (AVG ${lastAvg}h)`, value: parseFloat(lastAvg) },
      { name: `This week (AVG ${thisAvg}h)`, value: parseFloat(thisAvg) },
    ];
  }

  const COLORS = ["#f59e0b", "#fbbf24"];

  return (
    <View style={styles.container}>
      <View style={styles.wrapper}>
        {/* Header */}
        <Text style={styles.headerTitle}>SUNSHINE DURATION</Text>
        <Text style={styles.headerSub}>SOURCE: FAST API (MOCK)</Text>
        <Text style={styles.headerSub}>UPDATED: AUG 28, 22:00</Text>

        {/* Toggle */}
        <View style={styles.toggleRow}>
          <View style={styles.toggle}>
            <Text style={styles.toggleText}>DAY</Text>
          </View>
          <View style={[styles.toggle, styles.toggleActive]}>
            <Text style={styles.toggleTextActive}>WEEK</Text>
          </View>
          <View style={styles.toggle}>
            <Text style={styles.toggleText}>MONTH</Text>
          </View>
        </View>

        {/* 3-column layout */}
        <View style={styles.row}>
          {/* Weekly Trend */}
          <View style={[styles.card, styles.flex1]}>
            <Text style={styles.cardTitle}>Weekly Trend</Text>
            <View style={{ width: "100%", height: 250 }}>
              <ResponsiveContainer>
                <LineChart data={data}>
                  <CartesianGrid stroke="#e5e7eb" />
                  <XAxis dataKey="date" />
                  <YAxis />
                  <Tooltip />
                  <Line
                    type="monotone"
                    dataKey="hours"
                    stroke="#f59e0b"
                    strokeWidth={2}
                    dot={{ r: 5 }}
                  />
                </LineChart>
              </ResponsiveContainer>
            </View>
            <Text style={styles.legend}>⬤ Sunshine (hr)</Text>
          </View>

          {/* Insights */}
          <View style={[styles.card, styles.flex1]}>
            <Text style={styles.cardTitle}>Insights</Text>
            <View style={styles.insightsRow}>
              <View style={styles.pill}>
                <Text style={styles.pillDot}>⬤</Text>
                <Text style={styles.pillText}>AVG {avg}H</Text>
              </View>
              <View style={styles.pill}>
                <Text style={styles.pillDot}>⬤</Text>
                <Text style={styles.pillText}>MAX {max}H</Text>
              </View>
              <View style={styles.pill}>
                <Text style={styles.pillDot}>⬤</Text>
                <Text style={styles.pillText}>MIN {min}H</Text>
              </View>
            </View>
          </View>

          {/* Historical Trends as Pie */}
          {pieData.length > 0 && (
            <View style={[styles.card, styles.flex1]}>
              <Text style={styles.cardTitle}>Historical trends</Text>
              <View style={{ width: "100%", height: 250 }}>
                <ResponsiveContainer>
                  <PieChart>
                    <Pie
                      data={pieData}
                      dataKey="value"
                      cx="50%"
                      cy="50%"
                      outerRadius={70}
                      label
                    >
                      {pieData.map((entry, index) => (
                        <Cell
                          key={`cell-${index}`}
                          fill={COLORS[index % COLORS.length]}
                        />
                      ))}
                    </Pie>
                    <Legend />
                  </PieChart>
                </ResponsiveContainer>
              </View>
            </View>
          )}
        </View>

        {/* Footer */}
        <Text style={styles.footer}>
          Timezone: IST · Units: hours/day {"\n"}Data randomized for demo
        </Text>
      </View>
    </View>
  );
}
